import employees from '../employees.json';

function App() {
  const [search, setSearch] = useState(employees);
  console.log(search)

  return (
    <div>
      <ButtonAppBar/>
      <Wrapper>
        <h1>Employee Directory</h1>
        <SearchBar data={search}/>
        <Table data={search}/>
      </Wrapper>
    </div>
  );
};

export default App;
